import React from 'react'

class Nav extends React.Component{
    render(){
        return(
            <div className='Nav'>
                <h1><Link to='/'>Login</Link></h1>
                <h1>Sign-Up</h1>
                <h1>Home</h1>
            </div>
        )
    }
}

export default Nav
